import React from "react";
import { connect } from "react-redux";
import { fetchAllTemplates } from "../../actions";

class TemplateList extends React.Component {
  render() {
    return <div>TemplateList</div>;
  }
}

export default connect(
  null,
  { fetchAllTemplates }
)(TemplateList);
